import React from 'react';

function DrywallInstallation() {
  return (
    <section className="py-20">
      <div className="container mx-auto px-4">
        <h2 className="text-4xl font-bold text-center mb-8">Drywall Installation</h2>
        <img src="https://images.unsplash.com/photo-1556911220-e15b29be8c5d" alt="Drywall" className="w-full h-96 object-cover rounded-lg mb-8" />
        <p className="text-lg text-center max-w-2xl mx-auto">
          Seamless drywall installation and repair services to perfect your walls before painting or finishing.
        </p>
      </div>
    </section>
  );
}

export default DrywallInstallation;
